import React from "react";

const Form = () => {
    return (
        <form>
        <div>
          <label>Note Title</label>
          <input
            type="text"
          />
        </div>
        <div>
          <label>Note Body</label>
          <input
            type="text"
          />
        </div>
        <button type="submit">Save</button>
        </form>
    )
};

export default Form;
